// src/pages/DonoList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function DonoList() {
  const [donos, setDonos] = useState([]);

  useEffect(() => {
    api.get('/donos').then((res) => setDonos(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between mb-3">
        <Link to="/" className="btn btn-secondary">← Voltar ao Início</Link>
        <Link to="/donos/novo" className="btn btn-primary">+ Cadastrar Novo Dono</Link>
      </div>

      <h2>Donos Cadastrados</h2>
      {donos.length === 0 ? (
        <p>Nenhum dono cadastrado ainda.</p>
      ) : (
        <ul className="list-group">
          {donos.map((dono) => (
            <li key={dono._id} className="list-group-item">
              <strong>{dono.nome}</strong> – CPF: {dono.cpf}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
